import React from 'react';
import { Box, Typography } from '@mui/material';

const Home: React.FC = () => {
    return (
        <Box>
            <Typography variant="h2">Accueil</Typography>
            <Typography variant="body1">Bienvenue sur la page d'accueil de notre application.</Typography>

        </Box>
    );
};

export default Home;
